import Intro from '../components/Intro';
import Sections from '../components/Sections';

const router = createBrowserRouter([
  {
    path: "/",
    element: <Intro />,
  }, {
    path: "/test",
    element: <h1>test</h1>,
  },
]);

type navigator = {
